import React, { useState } from "react";
import { Marker, InfoWindow } from "react-google-maps";
import iconmk from "../../../../public/assets/ic_parking.png";
import { makeStyles } from "@material-ui/core/styles";
import image from "../../../../public/assets/violation.jpg";
import Typography from "@material-ui/core/Typography";
import Dialog from "@material-ui/core/Dialog";
import DialogTitle from "@material-ui/core/DialogTitle";
import DialogActions from "@material-ui/core/DialogActions";
import { TableHead, TableRow, TableCell, Checkbox } from "@material-ui/core";
import TableContainer from "@material-ui/core/TableContainer";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
function MarkerComponent(props) {
  var iconmarker = {
    url: iconmk,
    scaledSize: new window.google.maps.Size(40, 40),
  };
  const classes = useStyles();
  const [opendialog, setOpendialog] = useState(false);
  const dialogtable = () => {
    setOpendialog(true);
  };
  const handleClose = () => {
    setOpendialog(false);
  };
  const handleToggle = () => {
    props.clearInfowindow()
}
  return (
    <Marker
      position={{
        lat: parseFloat(props.marker.lat),
        lng: parseFloat(props.marker.lng),
      }}
      icon={iconmarker}
    >
      {props.Infowindow.lat === props.lat &&
      props.Infowindow.lng === props.lng ? (
        <InfoWindow onCloseClick={()=>handleToggle()}>
          <div className={classes.Info}>
            <Typography variant="subtitle1">
              <b className={classes.title}>Tuyến đường:</b>
              {props.marker.stress}
            </Typography>
            <Typography variant="subtitle1">
              <b className={classes.title}>Biển số:</b>
              {props.marker.vehicle}
            </Typography>
            <Typography variant="subtitle1">
              <b className={classes.title}>Ngày vi phạm:</b>
              {props.marker.date}
            </Typography>
            <div
            //   className={classes.infotitlepopup}
              onClick={() => dialogtable()}
            >
              <a  className={classes.infotitlepopup}>thông tin chi tiết...--></a>
            </div>
            <img className={classes.imgpopup} src={image}></img>
          </div>
        </InfoWindow>
      ) : null}
      {opendialog ? (
        <Dialog
          open={opendialog}
          onClose={() => handleClose()}
          aria-labelledby="form-dialog-title"
          className={classes.dialog}
        >
          <DialogTitle id="form-dialog-title">Chi tiết vi phạm</DialogTitle>
          <Table className={classes.table} aria-label="simple table">
            <TableHead>
              <TableRow>
                {/* <TableCell>
                    <Checkbox
                        size="small"
                        color="primary"
                        // indeterminate={violationSelected.length > 0 && violationSelected.length < listViolation.length}
                        // checked={listViolation.length > 0 && violationSelected.length === listViolation.length}
                        // onChange={handleSelectAllClick}
                    />
                </TableCell> */}
                <TableCell align="center"> Ảnh </TableCell>
                <TableCell align="center"> Biển số </TableCell>
                <TableCell align="center">Lỗi vi phạm </TableCell>
                <TableCell align="center"> Ngày vi phạm </TableCell>
                <TableCell align="center"> Tuyến đường vi phạm </TableCell>
                <TableCell align="center"> Đơn vị xử lí </TableCell>
                <TableCell align="center"> Loại Phương Tiện </TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
            <TableRow>
              <TableCell component="th" scope="row">
                  <img src={image} className={classes.imagepopup}></img>
                {/* {props.marker.image} */}
              </TableCell>
              <TableCell>{props.marker.vehicle}</TableCell>
              <TableCell align="center">{props.marker.type}</TableCell>
              <TableCell align="center">{props.marker.date}</TableCell>
              <TableCell align="center">{props.marker.stress}</TableCell>
              <TableCell align="center">{props.marker.Processingunit}</TableCell>
              <TableCell align="center">{props.marker.typeVehicle}</TableCell>
            </TableRow>
            </TableBody>
          </Table>
          {/* <DialogActions>
              <Button onClick={handleClose} color="primary">
                Cancel
              </Button>
              <Button onClick={handleClose} color="primary">
                Subscribe
              </Button>
            </DialogActions> */}
        </Dialog>
      ) : null}
    </Marker>
  );
}
export default MarkerComponent;
const useStyles = makeStyles((theme) => ({
  Info: {},
  imgpopup: {
    width: "100%",
  },
  title: {
    fontWeight: 500,
  },
  dialog:{
      height:"100%",
      width:'100%'
  },
  imagepopup:{
      width:250
  },
  infotitlepopup:{
      cursor:'pointer',
      color:'blue',
      fontSize:14,
      float:'right',
      marginBottom:5
  }
}));
